body:
 `/time` API 하나만 제공하는 서버입니다.
 최초 구동시 ./time.txt 에 제한 시간을 파일로 작성하고 전역변수로 가져옵니다
 
`GET /time` :  남은 시간 DHMS : MS 로 반환

```
// 요청 Success : 200
{
    "result" : 'success',
    "remainTime": {
        "day": 6,
        "hour": 23,
        "minute": 48,
        "second": 49,
        "millisecond": 219
    }
}
// 요청 Failed : 500
{
    "result" : 'No limit time'
}
```

`POST /time` :  남은 시간 리셋

```
// 요청 Success : 200
{
    "result" : 'Refreshed'
}
// 요청 Failed : 500
{
    "result" : 'failed'
}
```
